import React from 'react';

import {Link} from 'react-router-dom';
import video2 from '../../../content/video2.mp4';
export default class Video extends React.Component{
   constructor(props){
       super(props);
        
   } 


   render(){
       console.log('video props', this.props);
       return(
        <div className="container__block" id="menu__enter">
        <video className="video2 videoPlay" id="v1" muted loop>
            <source src={video2}/>
            
        </video>
        <div className="block__descr_container">
            <div className="block_descr v1">
                <img src="./imgs/croissant.svg" alt="menu" className="block_img"/> 
                <Link to="/topics">Наше меню</Link>
                <p className="block__text">Удивляем не только напитками, но и блюдами</p>
            </div>
        </div>

    </div>
       );
   }

}
